import { css } from "@emotion/css";
export const navigationContainer = css`
  height: 10vh;
  max-height: 10vh;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  width: 100%;
  z-index: 10;
  position: fixed;
  left: 0px;
  top: 0px;
  background: #FFFFFF;
`;
export const linksContainer = css`
  display: flex;
  flex-direction: row;
  list-style-type: none;

  padding: 20px 50px 20px 0px;
`;
